var app = {
	// Application Constructor
	initialize: function() {
		this.bindEvents();
	},
	// Bind Event Listeners
	//
	// Bind any events that are required on startup. Common events are:
	// 'load', 'deviceready', 'offline', and 'online'.
	bindEvents: function() {
		document.addEventListener('deviceready', this.onDeviceReady, false);
	},
	// deviceready Event Handler
	//
	// The scope of 'this' is the event. In order to call the 'receivedEvent'
	// function, we must explicity call 'app.receivedEvent(...);'
	onDeviceReady: function() {
		app.receivedEvent('deviceready');
	},
	// Update DOM on a Received Event
	receivedEvent: function(id) {
		var parentElement = document.getElementById(id);
		var listeningElement = parentElement.querySelector('.listening');
		var receivedElement = parentElement.querySelector('.received');
		listeningElement.setAttribute('style', 'display:none;');
		receivedElement.setAttribute('style', 'display:block;');
		//console.log('Received Event: ' + id);
		window.plugins.powerManagement.acquire();
		navigator.geolocation.watchPosition(app.onSuccessGeo, app.onErrorGeo, {
			frequency: 100
		});
		navigator.compass.watchHeading(app.onSuccessHeading, app.onErrorHeading, {
			frequency: 100
		});
		navigator.accelerometer.watchAcceleration(app.onSuccessAcceleration, app.onErrorAcceleration, {
			frequency: 100
		});
		setTimeout(function() {
			var startY = 0;
			var startX = 0;
			var b = document.body;
			b.addEventListener('touchstart', function(event) {
				parent.window.scrollTo(0, 1);
				startY = event.targetTouches[0].pageY;
				startX = event.targetTouches[0].pageX;
			});
			b.addEventListener('touchmove', function(event) {
				event.preventDefault();
				var posy = event.targetTouches[0].pageY;
				var h = parent.document.getElementById("scroller");
				var sty = h.scrollTop;
				var posx = event.targetTouches[0].pageX;
				var stx = h.scrollLeft;
				h.scrollTop = sty - (posy - startY);
				h.scrollLeft = stx - (posx - startX);
				startY = posy;
				startX = posx;
			});
		}, 1000);
	},
	vibrate: function() {
		navigator.notification.vibrate(100);
	},
	onSuccessGeo: function(position) {
		document.getElementById('geolocation').innerHTML = 'Latitude: ' + position.coords.latitude + '<br />' + 'Longitude: ' + position.coords.longitude;
		app.vibrate();
	},
	onErrorGeo: function(error) {
		document.getElementById('geolocation').innerHTML = 'Geo error code: ' + error.code + '<br />' + 'Error message: ' + error.message;
		app.vibrate();
	},
	onSuccessHeading: function(heading) {
		document.getElementById('compass').innerHTML = 'Heading: ' + heading.magneticHeading;
		app.vibrate();
	},
	onErrorHeading: function(compassError) {
		document.getElementById('compass').innerHTML = 'Compass error: ' + compassError.code;
		app.vibrate();
	},
	onSuccessAcceleration: function(acceleration) {
		document.getElementById('acceleration').innerHTML = 'Acceleration X: ' + acceleration.x + '<br />' + 'Acceleration Y: ' + acceleration.y + '<br />' + 'Acceleration Z: ' + acceleration.z + '<br />' + 'Timestamp: ' + acceleration.timestamp;
		app.vibrate();
	},
	onErrorAcceleration: function() {
		document.getElementById('acceleration').innerHTML = 'Errror with Acceleration';
	},
	onSuccessCamera: function(imageData) {
		document.getElementById('myImage').src = "data:image/jpeg;base64," + imageData;
	},
	onFailCamera: function(message) {
		document.getElementById('myImage').src = "data:image/png;base64,";
	},
	makePhoto: function() {
		navigator.camera.getPicture(app.onSuccessCamera, app.onFailCamera, {
			quality: 100
		});
	},
	downloadFile: function() {
		// !! Assumes filePath is a valid path on the device
		var servers = ['http://servermars.nl/100mb.bin', 'http://www.bbned.nl/scripts/speedtest/download/file100mb.bin', 'http://speedtest.exsilia.net/100mb.bin', 'http://www.kpnbroadbandvalley.nl/mxarena/downloads/100mb.bin', 'http://85.17.128.2/100mb.bin', 'http://www.mangelot.nl/100mb.bin', 'http://speedtest.onsbrabantnet.nl/files/100mb.bin', 'http://www.proserve.nl/100mb.bin', 'http://www.streamservice.nl/100mb.bin', 'http://download.xs4all.nl/test/100MB.bin'];
		var index;
		for (index = 0; index < servers.length; ++index) {
			var uri = encodeURI(servers[index]);
			var fileTransfer = new FileTransfer();
			fileTransfer.download(
			uri, filePath, function(entry) {
				console.log("download complete: " + entry.fullPath);
				entry.remove(success, fail);
				app.vibrate();
			}, function(error) {
				console.log("download error source " + error.source);
				console.log("download error target " + error.target);
				console.log("upload error code" + error.code);
				app.vibrate();
			}, true);
		}
	},
	success: function(entry) {
		console.log("Succeeded");
		app.vibrate();
	},
	fail: function(error) {
		console.log('Error');
		app.vibrate();
	}
};